subSubSection.paragraph:
Variation.
Antenna with 35–39 flagellomeres; first flagellomere 1.1–1.3× longer than second flagellomere; malar space 0.3–0.4× basal width of mandible; interocellar distance (
Fig. 56F
) 1.1–1.3× ocello-ocular distance and 1.2–1.7× distance between median and lateral ocelli; mesopleuron (
Fig. 56B
) granulose to rugulose-punctate; median longitudinal groove (
Fig. 56C
) weakly trans-striate to strongly trans-striate; hind femur 4.7–5.1× longer than wide; first tergite 3.2–3.8× longer than width of postpetiole; ovipositor sheath approx. 1.3–1.7× longer than hind femur; fore and mid coxa sometimes with basally brown; metasoma sometimes entirely black.
